const mapRealDataToProducers = (data: any[]): Producer[] => {
  return data.map((item, idx) => {
    const yieldFactor = 0.69; // Réduction de 31% pour réalisme agricole
    return {
      id: item.id,
      name: item.name,
      union: item.union as UnionName,
      parcelId: item.parcelId,
      location: item.location as [number, number],
      geometry: item.geometry,
      bbox: item.bbox,
      areaHectares: item.areaHectares, 
      areaM2: item.areaM2,
      yieldActual: parseFloat((item.yieldActual * yieldFactor).toFixed(2)),
      yieldExpected: parseFloat((item.yieldExpected * yieldFactor).toFixed(2)),
      productionTonnes: parseFloat((item.productionTonnes * yieldFactor).toFixed(2)),
      density: item.density,
      fertilityIndex: item.fertilityIndex,
      lastUpdate: '2025-08-15',
      village: item.village,
      phone: `+221 77 ${300 + (idx % 600)} ${10 + (idx % 80)} ${idx % 99}`,
      rasters: item.rasters || []
    };
  });
};

export const MOCK_PRODUCERS: Producer[] = mapRealDataToProducers(RAW_DATA);